export class LegendColorBinsLine {
    render() {
        return (h("as-legend-category", { data: this.data, orientation: this.orientation, width: this.width }));
    }
    static get is() { return "as-legend-color-bins-line"; }
    static get properties() { return {
        "data": {
            "type": "Any",
            "attr": "data"
        },
        "orientation": {
            "type": String,
            "attr": "orientation"
        },
        "width": {
            "type": Number,
            "attr": "width"
        }
    }; }
    static get style() { return "/**style-placeholder:as-legend-color-bins-line:**/"; }
}
